import React from 'react'
import Header from './Header'
import './App.css';
import { BrowserRouter, Switch, Route, Link } from 'react-router-dom'


function App() {
  return (
    <div className="App">
      <h1 className="title">Batch</h1>

      <BrowserRouter>
        <Header />

          <Route path="/groups">
            <h1>Groups Page</h1>
          </Route>

      </BrowserRouter>


    </div>
  );
}

export default App;
